import React,{useState} from 'react';

const Home = function(){
    const {posts, setPosts} = useState([]);
    fetch('http://localhost:3000/posts')
    .then((response) =>{
        response.json().then((result) =>{            
            setPosts(posts.push(result));
        })
    });
    return <>
        <h1>Blogs</h1>
    </>
}

export default Home
